import React from "react";
import { useForm } from "react-hook-form";

export default function Form() {
    const { register, handleSubmit } = useForm();
   
    return (
      <form onSubmit={handleSubmit(data => console.log(data))}>
        <h1>New Order</h1>
        <label>Name</label>
        <input name="name" {...register('value_name')} />
        <label>Address</label>
        <input name="address" {...register('value_name')} />
        <label>Date</label>
        <input name="date" {...register('value_name')} />
        <label>Order Number</label>
        <input name="order" {...register('value_name')} />
        <input type="submit" />
      </form>
    );
   }
